package com.eservice;

import javafx.application.Application;
import javafx.scene.Scene;
import javafx.scene.image.Image;
import javafx.scene.image.ImageView;
import javafx.scene.layout.StackPane;
import javafx.stage.Stage;

import java.io.ByteArrayInputStream;
import java.util.Base64;

public class DecodeBase64 extends Application {
    @Override
    public void start(Stage primaryStage) {
        // Assuming you have retrieved the Base64 string from the database
        String base64ImageString = "";

        // Step 2: Decode the Base64 string back into a byte array
        byte[] imageBytes = Base64.getDecoder().decode(base64ImageString);

        // Step 3: Create an Image object from the byte array
        Image image = new Image(new ByteArrayInputStream(imageBytes));

        // Step 4: Set the Image object in your ImageView
        ImageView imageView = new ImageView(image);

        StackPane root = new StackPane(imageView);
        Scene scene = new Scene(root, 300, 250);

        primaryStage.setTitle("ImageView from Base64");
        primaryStage.setScene(scene);
        primaryStage.show();
    }

    public static void main(String[] args) {
        launch(args);
    }
}
